void VTesterWrapper::trace(VerilatedVcdC* tfp, int, int) {
    tfp->spTrace()->addCallback(&VTesterWrapper::traceInit, &VTesterWrapper::traceFull, &VTesterWrapper::traceChg, this);
}
void VTesterWrapper::traceInit(VerilatedVcd* vcdp, void* userthis, uint32_t code) {
    // Callback from vcd->open()
    VTesterWrapper* t=(VTesterWrapper*)userthis;
    VTesterWrapper__Syms* __restrict vlSymsp = t->__VlSymsp;  // Setup global symbol table
    if (!Verilated::calcUnusedSigs()) {
	VL_FATAL_MT(__FILE__,__LINE__,__FILE__,"Turning on wave traces requires Verilated::traceEverOn(true) call before time 0.");
    }
    vcdp->scopeEscape(' ');
    t->traceInitThis(vlSymsp, vcdp, code);
    vcdp->scopeEscape('.');
}
void VTesterWrapper::traceFull(VerilatedVcd* vcdp, void* userthis, uint32_t code) {
    // Callback from vcd->dump()
    VTesterWrapper* t=(VTesterWrapper*)userthis;
    VTesterWrapper__Syms* __restrict vlSymsp = t->__VlSymsp;  // Setup global symbol table
    t->traceFullThis(vlSymsp, vcdp, code);
}

